// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.0 <0.9.0;

contract Payment {
  string name;

  function getBalance() public view returns (uint256) {
    return msg.sender.balance;
  }

  function payMe() public payable {}

  // TODO: Add money to the contract before selling. The problem lies with that the function wants to transfer money without money on the contract

  /// Function to transfer money to other user
  function transferMoney(address payable _to, uint256 _amount) public payable {
    // bytes memory data
    // require(msg.value >= _amount, "Not enough Ether");
    require(address(this).balance >= _amount, "Insufficient funds in the contract");

    (bool success,) = _to.call{value: _amount}(abi.encode(_to, _amount));
    require(success, 'Failed to send Ether');
  }

  function sendPayment(address payable recipient, uint256 amount) public payable {
    recipient.transfer(amount);
  }
}
